import React, {useState} from "react";
import { Link } from 'react-router-dom';
import './landlord.css';



export function Landlord() 
{
    const [addSection, setAddSection] = useState(false);
    const [formData, setFormData] = useState({

        title: String,
        name: String,
        surname: String,
        phone: String,
        email: String,
        address1: String,
        address2: String,
        town: String,
        city: String,
        eircode: String,



    });

    const handleSubmit = (e) => {

        e.preventDefault();
    }


    return (
        <div>
            <div className="container">
                <butoon className="btn btn-primary" onClick={()=>setAddSection(true)} >Create Landlord</butoon>

                {
                    addSection &&(
                            <div className="addContainer">
                                <form onSubmit={handleSubmit}>
                            <div className="btn btn-danger close-btn" onClick={()=>setAddSection(false)}>close</div>

                        
                            <label htmlFor="title">Title:</label>
                            <input type="text" id="title" name="title" required></input>

                            <label htmlFor="name">First Name:</label>
                            <input type="text" id="name" name="name" required></input>

                            <label htmlFor="surname">Surname:</label>
                            <input type="text" id="surname" name="surname" required></input>

                            <label htmlFor="phone">Phone:</label>
                            <input type="number" id="phone" name="phone" required></input>

                            <label htmlFor="email">Email:</label>
                            <input type="email" id="email" name="email" required></input>

                            <label htmlFor="address1">Address Line 1:</label>
                            <input type="text" id="address1" name="address1" required></input>

                            <label htmlFor="address2">Address Line 2:</label>
                            <input type="text" id="address2" name="address2" ></input>

                            <label htmlFor="town">Town:</label>
                            <input type="text" id="town" name="town" required></input>

                            <label htmlFor="city">City:</label>
                            <input type="text" id="city" name="city" required></input>

                            <label htmlFor="eircode">Eircode:</label>
                            <input type="text" id="eircode" name="eircode" required></input>

                            <button type="submit" className="btn btn-primary">Submit</button>

                    </form>
                </div>

                    )
                }
                
            </div>
        </div>
    );
}

export default Landlord;
